import React, {Component} from 'react';
import './footer.css';

class Footer extends Component{

    render(){
        return(
            <div id="footer">
		        <div class="container">
			        <div class="row">
				        <div class="col-lg-4">
					        <h4>Moja adresa</h4>
					        <p>
						        Tomáš Bujna <br/>
						        Cintorínska 135,<br/>
						        95615 Kovarce, <br/>
						        Slovensko
					        </p>
				        </div>
		            </div>
	            </div>
            </div>
        );
    }
}
export default Footer;
